{
  "name": "AllTube Download",
  "description": "HTML GUI for youtube-dl",
  "repository": "https://github.com/Rudloff/alltube.git",
  "keywords": [
    "alltube",
    "download",
    "video",
    "youtube",
    "php"
  ],
  "buildpacks": [
    {
      "url": "heroku/php"
    },
    {
      "url": "heroku/python"
    }
  ],
  "env": {
    "PYTHON": {
      "description": "Path to python binary",
      "value": "/app/.heroku/python/bin/python"
    },
    "STREAM": {
      "description": "Enable stream mode",
      "value": "false",
      "required": false
    }
  }
}

{
  "name": "rudloff/alltube",
  "description": "HTML GUI for youtube-dl",
  "license": "GPL-3.0-only",
  "type": "project",
  "authors": [
    {
      "name": "Pierre Rudloff",
      "email": "contact@rudloff.pro",
      "homepage": "https://rudloff.pro/",
      "role": "Developer"
    },
    {
      "name": "Olivier Haquette",
      "email": "contact@olivierhaquette.fr",
      "homepage": "https://ographik.fr/",
      "role": "Designer"
    }
  ],
  "require": {
    "php": ">=7.4",
    "ext-intl": "*",
    "ext-json": "*",
    "aura/session": "^2.1",
    "barracudanetworks/archivestream-php": "^1.0",
    "consolidation/log": "^2.0",
    "cweagans/composer-patches": "^1.7",
    "j0k3r/httplug-ssrf-plugin": "^2.0",
    "jawira/case-converter": "^3.4",
    "jean85/pretty-package-versions": "^1.3",
    "mathmarques/smarty-view": "^1.2",
    "oomphinc/composer-installers-extender": "^2.0",
    "paragonie/csp-builder": "^2.5",
    "rinvex/countries": "^7.3",
    "rudloff/alltube-library": "^0.1.3",
    "symfony/finder": "^5.4",
    "symfony/translation": "^4.0",
    "symfony/yaml": "^4.0",
    "webfontkit/open-sans": "^1.0",
    "yt-dlp/yt-dlp": "^2023.03",
    "zonuexe/http-accept-language": "^0.4.1"
  },
  "require-dev": {
    "consolidation/robo": "^3.0",
    "enlightn/security-checker": "^1.4",
    "ergebnis/composer-normalize": "^2.20",
    "insite/composer-dangling-locked-deps": "^0.2.1",
    "junker/debugbar-smarty": "^0.1.0",
    "kitchenu/slim-debugbar": "^1.1",
    "maximebf/debugbar": "^1.16",
    "php-mock/php-mock-mockery": "^1.3",
    "phpro/grumphp": "^1.3",
    "phpstan/phpstan": "^0.12.72",
    "phpunit/phpunit": "^9.5",
    "povils/phpmnd": "^2.5",
    "smarty-gettext/smarty-gettext": "^1.6",
    "squizlabs/php_codesniffer": "^3.5",
    "symfony/error-handler": "^5.4",
    "symfony/var-dumper": "^5.4"
  },
  "repositories": [
    {
      "type": "package",
      "package": {
        "name": "yt-dlp/yt-dlp",
        "version": "2023.03.04",
        "dist": {
          "type": "tar",
          "url": "https://github.com/yt-dlp/yt-dlp/releases/download/2023.03.04/yt-dlp.tar.gz"
        }
      }
    }
  ],
  "autoload": {
    "psr-4": {
      "Alltube\\": "classes/"
    }
  },
  "autoload-dev": {
    "psr-4": {
      "Alltube\\Test\\": "tests/"
    }
  },
  "config": {
    "allow-plugins": {
      "composer/installers": true,
      "cweagans/composer-patches": true,
      "ergebnis/composer-normalize": true,
      "insite/composer-dangling-locked-deps": true,
      "oomphinc/composer-installers-extender": true,
      "php-http/discovery": true,
      "phpro/grumphp": true
    },
    "platform": {
      "php": "7.4.33"
    },
    "sort-packages": true
  },
  "extra": {
    "installer-paths": {
      "assets/{$name}": [
        "webfontkit/open-sans"
      ],
      "vendor/{$vendor}/{$name}/": [
        "type:library"
      ]
    },
    "installer-types": [
      "library"
    ],
    "patches": {}
  },
  "scripts": {
    "lint": "grumphp run --ansi",
    "release": "robo release --ansi",
    "test": [
      "Composer\\Config::disableProcessTimeout",
      "phpunit"
    ],
    "update-locales": [
      "tsmarty2c.php templates > i18n/template.pot",
      "xgettext --omit-header -kt -j -o i18n/template.pot classes/*.php classes/*/*.php"
    ],
    "youtube-dl": "vendor/ytdl-org/youtube-dl/youtube_dl/__main__.py"
  }
}

